  "type": "AdaptiveCard",
  "version": "1.0",
  "body": [
    {
      "type": "TextBlock",
      "text": "Hello World!"
    }
  ],
  "style": {
    "background": {
      "color": "#FF0000" // red background color
    }
  }
}
