import java.util.Scanner;

public class DialogueSystem {

    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);

        // Define the dialogue options
        String[] dialogueOptions = {
            "Do you want to go to the forest?",
            "Do you want to go to the mountain?",
            "Do you want to go to the river?"
        };

        // Define the corresponding actions for each option
        String[][] actions = {
            {"You are now in the forest.", "You see a bear."},
            {"You are now in the mountain.", "You see a eagle."},
            {"You are now in the river.", "You see a fish."}
        };

        // Display the dialogue options
        for (int i = 0; i < dialogueOptions.length; i++) {
            System.out.println((i + 1) + ". " + dialogueOptions[i]);
        }

        // Get the user's choice
        System.out.print("Enter your choice (1, 2, or 3): ");
        int choice = scanner.nextInt();

        // Validate the user's choice
        if (choice < 1 || choice > 3) {
            System.out.println("Invalid choice. Please try again.");
            return;
        }

        // Display the corresponding action
        for (String action : actions[choice - 1]) {
            System.out.println(action);
        }
    }
}
```

