You can use the `@Scheduled` annotation in Spring Boot to schedule a task to run at a specified interval. Here's an example of how you can implement this:

```java
import org.springframework.scheduling.annotation.Scheduled;
import org.springframework.stereotype.Component;

import java.io.File;
import java.io.FileWriter;
import java.io.IOException;
import java.sql.*;
import java.util.ArrayList;
import java.util.List;

@Component
public class QueryRunner {

    private static final String QUERY_FILE = "query.sql";
    private static final String RESULT_FILE = "result.txt";
    private static final String DB_URL = "jdbc:mysql://localhost:3306/mydb";
    private static final String DB_USERNAME = "myuser";
    private static final String DB_PASSWORD = "mypassword";

    @Scheduled(fixedDelay = 3600000) // 1 hour
    public void runQuery() {
        String query = readQueryFromFile(QUERY_FILE);
        List<String> result = runQuery(query);
        writeResultToFile(RESULT_FILE, result);
    }

    private String readQueryFromFile(String filename) {
        try {
            return new String(Files.readAllBytes(Paths.get(filename)));
        } catch (IOException e) {
            throw new RuntimeException("Error reading query file", e);
        }
    }

    private List<String> runQuery(String query) {
        try (Connection conn = DriverManager.getConnection(DB_URL, DB_USERNAME, DB_PASSWORD);
             Statement stmt = conn.createStatement();
             ResultSet rs = stmt.executeQuery(query)) {

            List<String> result = new ArrayList<>();
            while (rs.next()) {
                result.add(rs.getString(1));
            }
            return result;
        } catch (SQLException e) {
            throw new RuntimeException("Error running query", e);
        }
    }

    private void writeResultToFile(String filename, List<String> result) {
        try (FileWriter writer = new FileWriter(filename)) {
            for (String row : result) {
                writer.write(row + "\n");
            }
        } catch (IOException e) {
            throw new RuntimeException("Error writing result file", e);
        }
    }
}
```

This code reads the SQL query from a file named `query.sql`, runs the query against a MySQL database, and writes the result to a file named `result.txt`. The `@Scheduled` annotation is used to schedule the `runQuery` method to run every hour.

Note that you'll need to replace the placeholders (`DB_URL`, `DB_USERNAME`, `DB_PASSWORD`) with your actual database connection details.

